import React from 'react';
import './App.css';
import Main from './app/Main';
import AOS from 'aos';
import 'aos/dist/aos.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import CompGraphics from './app/CompGraphics';
import Blog0 from './app/Blog0';

class App extends React.Component {
  constructor(props){
    super(props);
  }
  componentDidMount(){
    AOS.init({
      duration : 2000
    })
  }
  render(){
    return(
      <Router>
        <div>
            <nav>
              <div className="App">
                <Link to="/"></Link>
              </div>
            </nav>
            <Switch>
              <Route path="/computer_graphics">
                <CompGraphics />
              </Route>

              <Route path="/">
                <Main></Main>
              </Route>
            </Switch>
        </div>
    </Router>
    )
  }
};

export default App;
